import React from 'react'

const Login = () => {
  return (
    <div>
      <form className='login-form'>
        <input type='email' className='id-input'/>
        <input type='password' className='pw-input'/>
        <button className='login-button'>로그인</button>
      </form>
    </div>
  )
}

export default Login
